export default function Warning() {
	return (
		<div className="pt-2 content">
			<span className="has-text-danger">Please note:</span>
			<ul>
				<li>Recommended transfer per batch is 200.</li>
				<li>Do not transfer to an exchange wallet.</li>
				<li>Checkout <a href="/faqs">FAQs</a> for usage and slow Metamask.</li>

			</ul>
		</div>
	)
}
